the_loop: LOOP



fetch table_cur into cur_table;

 IF no_more THEN
        CLOSE table_cur;
        LEAVE the_loop;
    END IF;
    
set @SQL_STRING = concat( 'select  count(*) into @row_count from ',cur_table);

prepare stmt from @SQL_STRING;

execute stmt;

deallocate prepare  stmt;

insert tbl_cnt 
values( cur_table, @row_count);
    
END LOOP the_loop;

select * from tbl_cnt;

drop table tbl_cnt;

END */;;
